import { HttpStatus, INestApplication } from '@nestjs/common';
import { AppModule } from '../../src/app.module';
import * as request from 'supertest';
import { Test } from '@nestjs/testing';

describe('Read public file should', () => {
  let application: INestApplication;

  beforeEach(async () => {
    const module = await Test.createTestingModule({
      imports: [AppModule],
    }).compile();
    application = module.createNestApplication();
    await application.init();
  });

  afterEach(async () => {
    await application.close();
  });

  it('download a pdf file', async () => {
    const fileId = '23ffcc43-4860-496e-9aff-ded38265747a';
    const url = `/public/files/${fileId}`;
    const response = await request(application.getHttpServer()).get(url);
    expect(response.statusCode).toBe(HttpStatus.OK);

    const expectedFile =
      '';

    expect(response.body.toString('base64')).toBe(expectedFile);
  });
});
